import { Button, List } from 'antd';

const FollowList = ({ header, data }) => {
  <List
    style={{ marginBottom: 20 }}
    gridl={{ gutter: 4, xs: 2, md: 3 }}
    size="small"
    header={<div>{header}</div>}
    loadMore={
      <div>
        <Button>더보기</Button>
      </div>
    }
  />;
};

export default FollowList;
